namespace advent_of_code_2018
{
    using System;
    using System.Linq;
    using System.Collections.Generic;

    public class Day05
    {
        private const string Problem1Input = @"";

        public static int SolveProblem1()
        {
            var polymer = Problem1Input;
            var reacted = false;

            do {
                reacted = false;
                for (var i=polymer.Length - 1; i>0; i--)
                {
                    if (i >= polymer.Length)
                    {
                        continue;
                    }
                    if (polymer[i] != polymer[i-1] && polymer[i].ToString().ToLower() == polymer[i-1].ToString().ToLower())
                    {
                        polymer = polymer.Remove(i-1,2);
                        reacted = true;
                    }
                }
            } while (reacted);

            return polymer.Length;
        }

        public static int SolveProblem2()
        {

            var reacted = false;
            var shortest = int.MaxValue;
            var alphabet = "abcdefghijklmnopqrstuvwxyz";

            for (var a=0; a<alphabet.Length; a++)
            {
                var polymer = Problem1Input;
                polymer = String.Concat(polymer.Where(c => c.ToString().ToLower() != alphabet[a].ToString()));
                do {
                    reacted = false;
                    for (var i=polymer.Length - 1; i>0; i--)
                    {
                        if (i >= polymer.Length)
                        {
                            continue;
                        }
                        if (polymer[i] != polymer[i-1] && polymer[i].ToString().ToLower() == polymer[i-1].ToString().ToLower())
                        {
                            polymer = polymer.Remove(i-1,2);
                            reacted = true;
                        }
                    }
                } while (reacted);
                if (polymer.Length < shortest)
                {
                    shortest = polymer.Length;
                }
            }

            return shortest;
        }
    }
}